import React from "react";
import './app.'
const Parents = () => {
    return ( 
        <div>
            <div className="subscribe">
  <p>Get</p>
  <input placeholder="Your e-mail" className="subscribe-input" name="email" type="email" />
  <br />
  <div className="submit-btn">Submit</div>
</div>
        </div>
     );
}
 
export default Parents;
